`,n.jsx(e.p,{children:"To understand CRDs you need to first know what a resource is. Pods, Deployments, Services etc are all resources. Formally"}),`
`,n.jsxs(e.blockquote,{children:[`
`,n.jsxs(e.p,{children:["A resource is an endpoint in the ",n.jsx(e.a,{href:"https://kubernetes.io/docs/concepts/overview/kubernetes-api/",children:"Kubernetes API"})," that stores a collection of ",n.jsx(e.a,{href:"https://kubernetes.io/docs/concepts/overview/working-with-objects/#kubernetes-objects",children:"API objects"})," of a certain kind; for example, the built-in pods resource contains a collection of Pod objects."]}),`
`]}),`
`,n.jsxs(e.p,{children:["Resources are in built within the Kubernetes API. But in our case, we said one of the main resons we build operators is to handle custom problems that Kubernetes does not solve out of the box. In some cases we might need to define our own resource objects. Forexample. Imagine we are building an operator that manages postgreSql databases, we would like to provide an API to define configurations of each database we initiate, we can do this by defining a Custom resource definition ",n.jsx(e.code,{children:"PGDatabase"})," as an Object that stores the configuration of the database."]}),`
